INSERT INTO `hunting` VALUES (2,'저는 백엔드 지망으로 java, spring, mysql 사용 경험 있습니다!\n저 좀 데려가 주세요...\n소처럼 일 할게요!','저 좀 데려가 주실 팀 없나요..? 열심히 하겠습니다!',3),(3,'c++언어랑 arduino 전문적으로 배우고 프로젝트 경험 쌓을 예정입니다!','토이 프로젝트 아이디어 있으시면 같이 해요!',1),(4,'작은 프로젝트하면서 경험쌓으실 착한 분 구해요','혼자 공부하기 너무 힘든데',2),(6,'REST API, 스프링 부트, JPA, AWS, MYSQL 등 가능합니다!\n깃 사용 경험 있고 열심히 할 자신 있습니다.\n성격도 얼굴처럼 둥글둥글 합니다~ 편하게 연락주세요ㅎㅎ','백엔드 희망합니다.',4),(7,'현재 백엔드 2명, iot개발자 1명, 프론트 1명, 하드웨어 1명있습니다. 파이썬으로 tensolflow 구현하실 ai 1분 구해요~~','라즈베리파이와 젯슨나노보드를 이용한 자율주행자동차',6),(23,'2','2',6),(24,'프로젝트 구인글도 올렸습니다 ㅎㅎ \n참고하시고 궁금하신점은 DM 보내주세요~','IOT 관심있으신 분, 저랑 프로젝트해요 !!',27),(25,'안데려가면 지상렬','나 데려가삼',25),(26,'지존왕천재 개발자입니다','저는 싸피 코치입니다. 데려가세요',9),(27,'같이 해요! 백엔드 지망입니다.','10월 달에 토이프로젝트 구상 중인 사람',2),(28,'알고리즘은 자신 있어옹','알고리즘 플레티넘 AI관련 스터디 들어가요~',6);
/*!40000 ALTER TABLE `hunting` ENABLE KEYS */;
UNLOCK TABLES;

