INSERT INTO `project` VALUES (1,'같이 토이프로젝트 진행할 팀원을 구합니다!\n\n백엔드 한명, 프론트 엔드 한명 구해요!\n\n예상기간은 1달 정도일 것 같습니다!','2022-08-17 20:36:04.248349',4,'미정','2022-08-22 09:00:00.000000','같이 프로젝트할 팀원 구해요!',6,3),(2,'아두이노 관련해서 진짜 간단한 토이프로젝트할 사람 구합니다.','2022-08-17 20:42:37.530921',1,'미정','2022-08-26 09:00:00.000000','간단한 토이프로젝트할 사람구해요',4,1),(9,'주제 미정.\n일주일컷으로 빡세게 프로젝트 하실 분 구합니다 \n자유롭게 DM 주ㅆ ㅔ용','2022-08-18 23:19:37.534373',1,'오프라인','2022-08-21 09:00:00.000000','간단한 스피드런 토이프로젝트 @@@ 너만 오면 ㄱㄱㄱㄱㄱㄱㄱㄱㄱ',3,26),(10,'생활속에서 적용할만한 간단한 사물인터넷 구상하고 있습니다 ~\n온라인 오프라인 병행할 예정이고 빵판 작업할때는 무조건 만나서 했으면 좋겠어요 ~\n회로 설계 다되면 그이후로는 온라인 \nDM 주세용 ~\n아니면 카톡 주세요\n\n','2022-08-18 23:44:32.452132',1,'오프라인','2022-08-20 09:00:00.000000','저랑 IOT 프로젝트 하실분 !!',4,27),(11,'팀원 한명당 서버개설\n백프 구분없이 개인당 풀스택 구현후 도커라이징후 배포예정입니다.\n\nCI/CD 관심 많으신분 연락주세용','2022-08-19 00:18:01.940731',1,'온라인','2022-08-22 09:00:00.000000','MSA적으로 개발해서 도커라이징할 팀 모집합니다',6,25),(14,'현재 서버와 백엔드는 구했고 프론트 3명 구해요. 프론트 구하기가 하늘의 별따기네요.. 같이 할 사람??','2022-08-19 10:00:14.458409',6,'온라인','2022-08-20 09:00:00.000000','작은 토이프로젝트 백프론트구해요',9,2),(15,'저는 사람을 구합니다.','2022-08-19 10:07:44.762021',3,'온라인','2022-08-18 09:00:00.000000','운영체제 스터디 구해요',6,8),(16,'뭐라도 합니다. 3인분 같은 2인분해요~~','2022-08-19 10:12:06.495597',2,'미정','2022-08-25 09:00:00.000000','비전공 작은 프로젝트 같이 해요~',5,4),(17,'ai관련해서 하나 하실 분~?','2022-08-19 10:20:41.213720',2,'미정','2022-09-29 09:00:00.000000','텐서플로우 토이프로젝트',4,6);
