INSERT INTO `study` VALUES (1,'매주 월, 목 9시에 할 예정입니다~ 가끔씩 대면으로 할 거고, 서울에서 할 예정입니다!','2022-08-17 20:48:13.012322',3,'미정','2022-08-18 09:00:00.000000','취업대비 cs스터디하실 분 구합니다.',6,2),(2,'같이 파이썬이랑 C언어 공부하실 분 구해요!\n시간이랑 횟수는 같이 조정할 예정이고 오프라인으로 진행할 예정이에요! 노원구 인근 생각 중이긴 하지만 같이 조정해보면 좋을 거 같습니다~~','2022-08-18 11:39:08.165470',2,'오프라인','2022-08-31 09:00:00.000000','스터디 할 사람 여기여기 붙어라~~~',4,3),(4,'- 알고리즘 공부 (백준기준으로 하루에 한문제씩 코드리뷰)\n- 자소서 서로 첨삭\n\n','2022-08-19 00:20:13.647960',6,'온라인','2022-08-27 09:00:00.000000','SSAFY 9기 대비 스터디 모집',3,25),(5,'저랑 매일 백준문제 매일매일 푸실분 구합니다\n저는 브론즈 입니다 하하하 !','2022-08-19 03:03:08.199564',1,'오프라인','2022-08-20 09:00:00.000000','백준 다이아 가즈아',7,27),(6,'면접대비 기초 cs 스터디 구해요. 장소는 역삼역! 언제든지 오세용','2022-08-19 10:01:13.107635',4,'오프라인','2022-09-01 09:00:00.000000','면접 cs 스터디 구해요',6,2),(7,'강남역 카페에서 그냥 이것저것 공부해봐요.','2022-08-19 10:12:38.339910',1,'미정','2022-09-03 09:00:00.000000','소규모 스터디 구해요',3,4),(8,'사람 구하거나 이미 하는 곳에 들어갑니다~','2022-08-19 10:21:24.564051',1,'미정','2022-08-25 09:00:00.000000','ai 스터디 할 사람 구해요',4,6);
