INSERT INTO `til` VALUES (1,'‘짧은 거리를 전력 질주하다’ 라는 뜻의 Sprint, 개발에서는 어떻게 쓰이고 있을까요?\n\n스프린트는 구글 수석디자이너 제이크 냅이 고안한 기획실행법으로, 팀원들과 토론을 통해 도출된 아이디어를 단기간 내에 프로토타입으로 제작하고 테스트하여 중요한 문제들에 대한 답을 찾아가는 과정입니다.\n상품이나 서비스 혹은 조직이 당면한 문제에 대해 단기간 내에 시뮬레이션하여 시간과 자원을 효과적으로 사용할 수 있는 개발 방식으로 특히, 스타트업에서는 실제로 제품을 구축하고 실시하는 위험한 과정에 착수하기 전에 자신들이 제대로 가고 있는지 확인해볼 방법을 제시합니다.','2022-08-17 20:08:43.042269','오늘의 TIL: 스프린트란?',1),(2,'정말 JWT는 어려운 것 같다... 너무 어려워서 스트레스 받았지만 오늘 하루도 화이팅!','2022-08-17 20:14:52.565538','JWT를 공부한 오늘',1),(20,'8월 17일\n오늘은 발표 준비를 했어요\n팀원들이 다들 많이 힘들어보여요\n다들 끝까지 화이팅했으면 좋겠어요!\n싸피 7기 화이팅!','2022-08-17 20:31:17.368412','오늘의 공부일지',3),(23,'','2022-08-17 22:33:47.030376','야호야ㅐ호야호야호',7),(24,'코게더 ~  !','2022-08-17 22:34:24.901349','야호야호',7),(33,'ㅁㄴㅇㄴㅁㅇ','2022-08-18 11:04:28.767129','ㅁㄴㅇㅁㅇ',7),(34,'ㅁㄴㅇㄴㅁㅇ','2022-08-18 11:04:29.893404','ㅁㄴㅇㅁㅇ',7),(35,'ㄴㅇㄴ','2022-08-18 11:06:21.797633','ㅇㄴㅇ',7),(36,'ㅂㅈㄷㅂㄷㅂ','2022-08-18 11:06:36.038790','ㄷㅈㅂㄷㅂ',7),(37,'오늘도 발표 준비를 하고 있다... 다들 화이팅....','2022-08-18 11:35:48.783580','오늘의 공부일지',3),(38,'','2022-08-18 11:42:51.155000','',7),(39,'ㅁㄴㅇ','2022-08-18 11:43:03.746761','ㅁㄴㅇ',7),(40,'ㅁㄴㅇ','2022-08-18 11:43:10.558775','ㅁㄴㅇ',7),(41,'오늘 피피티를 만들었다.\n웹소켓 다시 공부하려니까 넘넘 재미읎다.\n미리캔버스 좋아요~','2022-08-18 16:07:56.640265','나두 TIL 등록하고 싶어!',4),(42,'코코게게게더더더','2022-08-18 23:14:53.867840','첫번째 피드 ~',26),(43,'텐서플로우를 공부했다 \n텐서플로우 첫화면에 있는 코드로 숫자이미지를 인식하는 코드를 작성해보았습니다 ','2022-08-18 23:16:17.250275','오늘의 공부 !',26),(45,'열심히 공부해야지 !!! \n#맞팔 #선팔 #개발자 #백엔드','2022-08-18 23:24:55.940310','코게더 가입하고 첫 글 >< !!',27),(46,'엑스비 쉴드와 어댑터를 이용하여 릴레이 모듈 제어해보는 연습해보았음 !','2022-08-18 23:48:02.324451','아두이노 XBEE 통신 연습',27),(47,'자바 진영의 ORM 기술 표준\n\n1 . JPA가 제공하는 API를 사용하면 객체를 DB에 저장하고 관리할 때, 개발자가 직접 SQL을 작성하지 않아도 된다.\n2. JPA가 개발자 대신 적절한 SQL을 생성해서 DB에 전달하고, 객체를 자동으로 Mapping 해준다.\n3. 이 때, JPA를 활용한다면 모든 SQL에 대해 개발자 대신 JPA가 자동으로 해결해 준다는 점에서 생산성을 크게 높인다.\n\n\n\n마이바티스만 써봤는데 자동으로 테이블 생성해주고 데이터 넣었다 뺏다가 너무 편하다 ㅎㅎ\nJPA 넘 똑똑해','2022-08-18 23:52:27.377655','JPA 공부 - JPA 란?',27),(48,'연봉 123954102934211억 개발자 되야지','2022-08-19 00:00:09.144101','안녕.. 난 지존지연이라구해',25),(49,'여기는... 멀티캠퍼스.......\n내 정수리위 컴퓨타..','2022-08-19 00:07:58.570636','스프링 띠용때용 이얍',25),(50,'난 떵으니라구해','2022-08-19 00:14:27.087096','안녕..',28),(51,'(੭•̀ᴗ•̀)੭','2022-08-19 00:40:09.116463','코게더에 오신 것을 환영합니다',8),(52,'(੭•̀ᴗ•̀)੭','2022-08-19 00:42:50.419377','코게더에 오신 것을 환영합니다',9),(54,'정말 힘드네요 자바도 잘 모르겠는데...','2022-08-19 02:26:49.877336','스프링 공부를 했습니다',5),(55,'직접 자습서를 읽어보니까 새로 알게 되는 내용이 참 많네요...\n프로그래밍에 대해 보는 시야가 넓어지는 느낌이었습니다.\n오랜만에 파이썬을 다시 보네요!','2022-08-19 02:29:13.930678','파이썬도 공부했습니다',5),(56,'그래도 다 해결되는 중이라 다행입니다.','2022-08-19 02:36:59.586912','프론트가 또 말썽이',5),(57,'오늘은 즐거운 발표 날!!\n팀원들과 밤을 새니 전혀 힘들지 않지 않아요~','2022-08-19 03:12:12.392498','나의 든든한 팀원들과 개발했어요!',4),(60,'코게더에 오신 것을 환영 합니다','2022-08-19 04:34:35.308636','코게더에 오신 것을 환영 합니다',32),(61,'JPA는 천재야. 자기가 알아서 테이블도 만들고...\n아주 개짱임.','2022-08-19 06:21:21.152344','우리.. 프로젝트 폴더 구조를 소개합니다',27),(62,'자바는 1995년 미국의 썬마이크로 시스템즈라는 회사에서 개발한 객체지향 언어이다 !\n자바는... 전세계에서 많이 쓰이고 있는 언어라구 합니다 ~~ ','2022-08-19 06:38:02.485118','자바란 무엇일까?',27),(63,'오늘은 드디어 떨리는 코게더 발표날! 다들 열심히 준비한만큼 끝까지 잘 마무리 했으면 좋겠다!\n싸피 7기 파이팅! 싸피 8반 파이팅!! 다들 공통 너무 수고했어요~~','2022-08-19 09:51:47.232852','08/19 오늘의 공부 일지',3),(64,'요즘따라 코딩을 하다가 배가 고플 때가 많다. 그럴 땐 참지않고 밥을 먹는다. \n근데 배가 고프면 졸리다. 역시 코딩의 길은 멀고도 험하다.','2022-08-19 09:54:34.081826','코딩하다 배가 고플 때가 많다.',1);
